import React, { useState } from 'react'
import Dialog from "../../components/Dialog"
import { useNavigate } from 'react-router-dom';
import useStore from '../../components/useStore';
const Header = () => {
  const [open, setOpen] = useState(false)
  const { users,fetchUsers } = useStore()
  const [usersData, setUsers] = useState("")
  const user=JSON.parse(localStorage.getItem("user"));

  const navigate=useNavigate()
  const handleClick = () => {
    if(user){
      setOpen(true)
    }
    else{
      navigate("/giris-yap")
    }


  }
  const handleClickUsers=()=>{
setOpen(true)
setUsers(users)
fetchUsers()
  }
  return (

    <div className='border-r-2 border-gray-100 md:col-span-2'>
      <h4 className="font-semibold text-slate-800">Menü</h4>
      <strong></strong>
      <div className='grid grid-cols-1'>
        <Dialog setOpen={setOpen} open={open} />
        <ul>

          <li onClick={handleClickUsers} usersData={usersData}>  Kullanıcılar</li>
          <li onClick={handleClick}>  Etiket ara</li>
        </ul>
      </div>
    </div>
  )
}

export default Header
